import React, { useState, useEffect } from "react";
import axios from "axios";
// import DataFetch from "./DataFetch";
// import minimalist4 from '../assets/minimalist4.jpg'
import minimalist5 from '../assets/minimalist5.jpg';
import { useNavigate } from "react-router-dom";
import Weather from './Weather';
import Texthome_1 from './Texthome-1';





//import { useCookies } from "react-cookie";
//import { useNavigate } from "react-router-dom";

// export const TransportDb = () => {
//   return (
//     <div className="auth">
//     {/* <Login /> */}
//       <Personel1 />


//     </div>
//   );
// };

export default function  TP1  () {
  const [id, setId] = useState("");
  const [pername,  setPername] = useState("");
  const [quantity , setQuantity ] = useState("");
  const [price, setPrice] = useState("");
  const [dameg, setDameg] = useState("");


  const navigate = useNavigate();

  useEffect(() => {
    if (!localStorage.getItem('userID')) {
      navigate('/');
    }

  }, []);

  const [alertMessage, setAlertMessage] = useState(""); // State to manage alert message
  const [alertType, setAlertType] = useState(""); // State to manage alert type (e.g., success, error)




  const onSubmit = async (event) => {
    event.preventDefault();
    try {
      await axios.post("/auth/personal1", {
        id,
        pername,
        quantity ,
        price,
        dameg,

      });
      // setClientname("");
      // setEmail("");
      // setQuantity("");
      // setPrice("");
      // setNote("");
      // setTotal("");
      // alert("Data transferred Successfully");
    // } catch (error) {
    //   console.error(error);
    // }
    // alert("Username already exists");
    setAlertMessage(" Data TranSsferred"); //Successfully 
    setAlertType("success");

  } catch (error) {
    setAlertMessage("Error Transferring ");
    setAlertType("error");
    console.error(error);
  }

  };

  ///


  useEffect(() => {
    // Automatically hide the alert after 5 seconds
    if (alertMessage) {
      const timeout = setTimeout(() => {
        setAlertMessage('');
      }, 4000); // Change the duration as needed (in milliseconds)

      return () => clearTimeout(timeout);
    }
  }, [alertMessage]);
  ////

  return (
    <div> 
     {/* <img  className="mainlogo" height='100px' width='100px' src={minimalist4} alt="" />  */}
     {/* <img  className="loading-ani-home1" height='200px' width='200px' src={minimalist5} alt="" />  */}

    <div className="data-container">

      <form onSubmit={onSubmit}>


      <Texthome_1 />


        <div className="form-group">
          <label htmlFor="id"></label>
          <input
            type="text"
            name="id"
            placeholder="Id"
            value={id}
            onChange={(event) => setId(event.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="pername"></label>
          <input
            type="text"
            name="pername"
            placeholder="pername"
            value={pername}
            onChange={(event) => setPername(event.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="quantity"></label>
          <input
            type="quantity "
            name="quantity "
            placeholder="Quantity"
            value={quantity }
            onChange={(event) => setQuantity (event.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="price"></label>
          <input
            type="price"
            name="price"
            placeholder="Price"
            value={price}
            onChange={(event) => setPrice(event.target.value)}
          />
        </div>
        <div className="form-group">
        <label htmlFor="dameg"></label>
        <input
          type="dameg"
          name="dameg"
